import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [systemStatus, setSystemStatus] = useState('loading');
  const [studentsCount, setStudentsCount] = useState(0);

  // Check system status on load
  useEffect(() => {
    checkSystemStatus();
  }, []);

  const checkSystemStatus = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/system/status');
      const data = await response.json();
      
      if (data.success) {
        setSystemStatus('ready');
        setStudentsCount(data.students);
      } else {
        setSystemStatus('error');
      }
    } catch (error) {
      console.error('Error checking system status:', error);
      setSystemStatus('error');
    }
  };

  return (
    <div className="App">
      <header className="app-header">
        <h1>üéì AI Attendance System</h1>
        <p>Smart Face Recognition for Student Attendance</p>
      </header>

      <main className="main-content">
        {/* System Status Card */}
        <div className="status-card">
          <h2>System Status</h2>
          <div className={`status-indicator ${systemStatus}`}>
            {systemStatus === 'ready' && '‚úÖ System Ready'}
            {systemStatus === 'loading' && 'üîÑ Loading...'}
            {systemStatus === 'error' && '‚ùå System Offline'}
          </div>
          
          {systemStatus === 'ready' && (
            <div className="system-info">
              <p><strong>Registered Students:</strong> {studentsCount}</p>
              <p><strong>Backend:</strong> Connected</p>
              <p><strong>Face Recognition:</strong> Ready to Initialize</p>
            </div>
          )}

          {systemStatus === 'error' && (
            <div className="error-message">
              <p>Please ensure the backend server is running on port 5000</p>
              <button onClick={checkSystemStatus} className="retry-btn">
                Retry Connection
              </button>
            </div>
          )}
        </div>

        {/* Navigation */}
        <div className="navigation-cards">
          <div className="nav-card">
            <h3>üë§ Student Registration</h3>
            <p>Register new students with face data</p>
            <button className="nav-btn" disabled={systemStatus !== 'ready'}>
              Open Registration
            </button>
          </div>

          <div className="nav-card">
            <h3>üîç Face Recognition</h3>
            <p>Recognize students for attendance</p>
            <button className="nav-btn" disabled={systemStatus !== 'ready'}>
              Start Recognition
            </button>
          </div>

          <div className="nav-card">
            <h3>üìä Admin Dashboard</h3>
            <p>View attendance and system analytics</p>
            <button className="nav-btn" disabled={systemStatus !== 'ready'}>
              Open Dashboard
            </button>
          </div>
        </div>
      </main>

      <footer className="app-footer">
        <p>AI-Powered Attendance System | Phase 1: Foundation Setup</p>
      </footer>
    </div>
  );
}

export default App;
